import * as React from 'react';

import { Typography, Divider, ThemeProvider } from '@material-ui/core';

const Featured = (props) => {

  return (
    <div className='featured'>
      <ThemeProvider theme={props.muiTheme}>
        <Divider variant="middle" />
      </ThemeProvider>
      <Typography variant='h3'>Resume</Typography>
      <div className='pdf'>
        <iframe title='John Zoscak Resume, 2021' src='http://docs.google.com/gview?a=v&pid=explorer&chrome=false&api=true&embedded=true&srcid=1hm2x2hlQXZmHrGEASsJem919KSJugsQG&hl=en&embedded=true' alt='PDF of Resume' frameborder="0"></iframe>
      </div>
    </div>
  );
}
export default Featured;
